  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Flint
  Hills National Wildlife Refuge summarizes refuge activities during the1991 calendar
  year.  The report begins with a summary of the yearu2019s highlights and climatic
  conditions.   Land acquisition-including land purchases is also covered.  The report
  includes a planning section which discusses management plans, compliance with environmental
  and cultural resource mandates, research and investigations.  Refuge administration
  is outlined; information about personnel, youth program, other manpower programs,
  volunteer programs, funding, safety, and other items is given.  Habitat management
  is also covered.  Subjects include wetlands, forests, cropland, grasslands, grazing,
  haying, fire management, pest control, and water rights.  The wildlife section of
  the report discusses endangered and/or threatened species, waterfowl, marsh and
  water birds, game mammals, other resident wildlife, fisheries resources, scientific
  collections.  The public uses of the refuge described in this report include general,
  outdoor student classrooms, interpretive foot trails, interpretive programs, hunting,
  fishing, wildlife observation, other wildlife oriented recreation, picnicking, and
  law enforcement.  The equipment and facilities section of the report provides information
  about new construction, rehabilitation and equipment utilization and replacement.
  \ Items of interest are provided at the end.\",\n\t\"license_title\": \"License
